import React, { useMemo } from 'react';

interface XLogoProps { size?: number; }

const X_PNG = 'data:image/png;base64,';

const XLogo = React.memo(({ size = 180 }: XLogoProps) => {
  const imgStyle = useMemo(() => Object.freeze({
    width: size,
    height: size,
    objectFit: 'contain' as const,
    display: 'block',
  }), [size]);

  return (
    <img
      src={X_PNG}
      alt="ZERØ MERIDIAN Logo"
      width={size}
      height={size}
      style={imgStyle}
    />
  );
});

XLogo.displayName = 'XLogo';
export default XLogo;
